import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1>Andrew's Final Project</h1>
          <h2>Stock App</h2>
        </header>
      </div>
    );
  }
}

export default App;
